import React, { useState } from 'react'
import { Button, Form, FormGroup, Label, Input } from 'reactstrap'

import api from '../../services/api'

export default Login => {
    const [email, setEmail] = useState('')
    const [password, setPassword] = useState('')

    const handleSubmit = async event => {
        event.preventDefault()
        console.log('result of the submit', email, password)
    }

    return (
        <Form>
            <FormGroup>
                <Input type="email" name="email" id="exampleEmail" placeholder="Enter your email" onChange={event => setEmail(event.target.value)} />
            </FormGroup>
            <FormGroup>
                <Input type="password" name="password" id="examplePassword" placeholder="Enter a password" onChange={event => setPassword(event.target.value)} />
            </FormGroup>
            <Button>Submit</Button>
        </Form>
    )
}
